

CREATE TABLE `almacen` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `barra_almacen` varchar(200) DEFAULT NULL,
  `stock_almacen` varchar(100) DEFAULT NULL,
  `precio_venta` varchar(100) DEFAULT NULL,
  `precio_mayor` varchar(100) DEFAULT NULL,
  `sucursal` varchar(100) DEFAULT NULL,
  `cod_sucursal` varchar(100) DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=1383 DEFAULT CHARSET=utf8mb4;




CREATE TABLE `caja` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `cantidad` varchar(100) DEFAULT NULL,
  `fecha` varchar(100) DEFAULT NULL,
  `sucursal` varchar(100) DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8mb4;




CREATE TABLE `cliente` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `nombre` varchar(60) DEFAULT NULL,
  `ruc_dni` varchar(60) DEFAULT NULL,
  `telefono` varchar(60) DEFAULT NULL,
  `direccion` varchar(100) DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=2 DEFAULT CHARSET=utf8mb4;




CREATE TABLE `detalle_notas` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `barra_nota` varchar(100) DEFAULT NULL,
  `precio_com` varchar(100) DEFAULT NULL,
  `descuento` varchar(100) DEFAULT NULL,
  `cantidad` varchar(100) DEFAULT NULL,
  `cod_nota` varchar(100) DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=7 DEFAULT CHARSET=utf8mb4;




CREATE TABLE `detalle_salidap` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `barra_salida` varchar(200) DEFAULT NULL,
  `precio` varchar(100) DEFAULT NULL,
  `cantidad` varchar(100) DEFAULT NULL,
  `descuento` varchar(100) DEFAULT NULL,
  `nrof` varchar(100) DEFAULT NULL,
  `sucursal` varchar(100) DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=13 DEFAULT CHARSET=utf8mb4;




CREATE TABLE `detalle_traslado` (
  `id` int(100) NOT NULL AUTO_INCREMENT,
  `nro_tras` varchar(100) DEFAULT NULL,
  `barra_tras` varchar(100) DEFAULT NULL,
  `cantidad` varchar(100) DEFAULT NULL,
  `de` varchar(100) DEFAULT NULL,
  `para` varchar(100) DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=4 DEFAULT CHARSET=utf8mb4;




CREATE TABLE `detalle_venta` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `barra_detalles` varchar(200) DEFAULT NULL,
  `cantidad` varchar(100) DEFAULT NULL,
  `precio` varchar(100) DEFAULT NULL,
  `descuento` varchar(100) DEFAULT NULL,
  `nrof` varchar(100) NOT NULL,
  `sucursal` varchar(100) NOT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=278 DEFAULT CHARSET=utf8mb4;




CREATE TABLE `failed_jobs` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `connection` text COLLATE utf8mb4_unicode_ci NOT NULL,
  `queue` text COLLATE utf8mb4_unicode_ci NOT NULL,
  `payload` longtext COLLATE utf8mb4_unicode_ci NOT NULL,
  `exception` longtext COLLATE utf8mb4_unicode_ci NOT NULL,
  `failed_at` timestamp NOT NULL DEFAULT current_timestamp(),
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;




CREATE TABLE `ingresos_salidas` (
  `id` int(100) NOT NULL AUTO_INCREMENT,
  `descripcion` varchar(100) DEFAULT NULL,
  `monto` varchar(100) DEFAULT NULL,
  `condicion` varchar(100) DEFAULT NULL,
  `fecha` varchar(100) DEFAULT NULL,
  `sucursal` varchar(100) DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=12 DEFAULT CHARSET=utf8mb4;




CREATE TABLE `marcas` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `nommar` varchar(45) DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=55 DEFAULT CHARSET=utf8mb4;




CREATE TABLE `migrations` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `migration` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `batch` int(11) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=5 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;




CREATE TABLE `movimientos` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `barra_mov` varchar(100) DEFAULT NULL,
  `nro_documento` varchar(100) DEFAULT NULL,
  `precio` varchar(100) DEFAULT NULL,
  `cantidad` varchar(100) DEFAULT NULL,
  `condicion` varchar(100) DEFAULT NULL,
  `tipo` varchar(100) DEFAULT NULL,
  `fecha` varchar(100) DEFAULT NULL,
  `detalle` varchar(100) DEFAULT NULL,
  `sucursal` varchar(100) DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=308 DEFAULT CHARSET=utf8mb4;




CREATE TABLE `notas` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `codigo_nota` varchar(100) DEFAULT NULL,
  `nro` varchar(100) DEFAULT NULL,
  `sucursal` varchar(100) DEFAULT NULL,
  `total` varchar(100) DEFAULT NULL,
  `ruc_provee` varchar(100) DEFAULT NULL,
  `empresa` varchar(100) DEFAULT NULL,
  `fecha` varchar(100) DEFAULT NULL,
  `estado` varchar(100) DEFAULT NULL,
  `anulado` varchar(2) DEFAULT NULL,
  `codicion` varchar(100) DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=8 DEFAULT CHARSET=utf8mb4;




CREATE TABLE `password_resets` (
  `email` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `token` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  KEY `password_resets_email_index` (`email`(250))
) ENGINE=MyISAM DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;




CREATE TABLE `permisos` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `traslados` varchar(5) DEFAULT NULL,
  `ventas` varchar(5) DEFAULT NULL,
  `sucursal_ventas` varchar(2) DEFAULT NULL,
  `reportes` varchar(5) DEFAULT NULL,
  `reporte_ingres` varchar(100) NOT NULL,
  `reporte_egreso` varchar(100) DEFAULT NULL,
  `ganancias` varchar(100) DEFAULT NULL,
  `clientes` varchar(5) DEFAULT NULL,
  `mantenimiento` varchar(5) DEFAULT NULL,
  `agregar_modif_mante` varchar(10) DEFAULT NULL,
  `almacen` varchar(100) DEFAULT NULL,
  `permisos` varchar(5) DEFAULT NULL,
  `rol` varchar(100) DEFAULT NULL,
  `compras` varchar(100) DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=14 DEFAULT CHARSET=utf8mb4;




CREATE TABLE `products` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `codigo` varchar(100) DEFAULT NULL,
  `barra` varchar(100) DEFAULT NULL,
  `nompro` varchar(300) DEFAULT NULL,
  `precio` varchar(100) NOT NULL,
  `marca` varchar(100) NOT NULL,
  `url_imagen` varchar(400) DEFAULT NULL,
  `baja` varchar(5) DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=1975 DEFAULT CHARSET=utf8mb4;




CREATE TABLE `proveedor` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `ruc` varchar(100) DEFAULT NULL,
  `nombre` varchar(100) DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=7 DEFAULT CHARSET=utf8mb4;




CREATE TABLE `rol` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `nomrol` varchar(60) NOT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=17 DEFAULT CHARSET=utf8mb4;




CREATE TABLE `salida_product` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `cod_sucursal` varchar(100) DEFAULT NULL,
  `nrof` varchar(100) DEFAULT NULL,
  `condicion` varchar(100) DEFAULT NULL,
  `total` varchar(100) DEFAULT NULL,
  `descripcion` varchar(400) DEFAULT NULL,
  `fecha` varchar(100) DEFAULT NULL,
  `sucursal` varchar(100) DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=10 DEFAULT CHARSET=utf8mb4;




CREATE TABLE `sucursal` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `nombre` varchar(100) NOT NULL,
  `codven` varchar(100) DEFAULT NULL,
  `codtras` varchar(100) DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=4 DEFAULT CHARSET=utf8mb4;




CREATE TABLE `traslados` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `nro` varchar(100) DEFAULT NULL,
  `sucursal` varchar(100) DEFAULT NULL,
  `cod_sucursal` varchar(50) DEFAULT NULL,
  `estado` varchar(100) DEFAULT NULL,
  `recibido` varchar(5) DEFAULT NULL,
  `para` varchar(100) DEFAULT NULL,
  `fecha` varchar(100) DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=6 DEFAULT CHARSET=utf8mb4;




CREATE TABLE `users` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `email` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `email_verified_at` timestamp NULL DEFAULT NULL,
  `password` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `remember_token` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `users_email_unique` (`email`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;




CREATE TABLE `usuarios` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(50) DEFAULT NULL,
  `email` varchar(50) DEFAULT NULL,
  `password` varchar(60) DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `dni` varchar(20) DEFAULT NULL,
  `sucursal` varchar(60) DEFAULT NULL,
  `rol` varchar(55) DEFAULT NULL,
  `id_sucursal` varchar(30) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=29 DEFAULT CHARSET=utf8mb4;




CREATE TABLE `ventas` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `nrof` varchar(100) DEFAULT NULL,
  `cod_sucursal` varchar(100) DEFAULT NULL,
  `nombre_cliente` varchar(100) DEFAULT NULL,
  `estado` varchar(100) DEFAULT NULL,
  `tipo_v` varchar(100) DEFAULT NULL,
  `estado_pago` varchar(100) DEFAULT NULL,
  `total_v` varchar(100) DEFAULT NULL,
  `total_ganancia` varchar(100) DEFAULT NULL,
  `ruc_dni_v` varchar(100) DEFAULT NULL,
  `sucursal` varchar(100) NOT NULL,
  `usuario` varchar(100) DEFAULT NULL,
  `fecha` varchar(100) DEFAULT NULL,
  `fecha_t` varchar(100) DEFAULT NULL,
  `anulado` varchar(2) NOT NULL,
  `xmayor` int(11) NOT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=223 DEFAULT CHARSET=utf8mb4;


